  \"2015-09-27T00:17:40.452310\",\n\t\"name\": \"temperature-profiles-from-mechanical-bathythermograph-mbt-casts-from-the-uss-ability-in-the-med\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"MBT data were collected from the USS ABILITY
  in support of the Fleet Observations of Oceanographic Data (FLOOD) project. Data
  were collected by US Navy; Ships of Opportunity from 01 February 1964 to 22 February
  1964. The platform was equipped and staffed to observe weather and sea conditions.
  Data were processed by NODC to the NODC standard Universal Bathythermograph Output
  (UBT) format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/bt.html.nnThe
  UBT file format is used for temperature-depth profile data obtained using the mechanical
  bathythermograph (MBT) instrument. The maximum depth of MBT observations is approximately
  285 m. Therefore, MBT data are useful only in studying the thermal structure of
  the upper layers of the ocean. Cruise information, date, position, and time are
  reported for each observation. The data record comprises pairs of temperature-depth
  values. Temperature data in this file are recorded at uniform 5 m depth intervals.\",\n\t\"license_title\":
